import React from 'react'
import { ImPointDown, ImYoutube2, ImTwitter, ImFacebook2, ImLinkedin } from "react-icons/im";



export const SnsItems = () => {
    return (
        <section className="sns">
            <span>Follow TOARu <ImPointDown/></span>
            <ul>
                <li><a href=""><ImYoutube2 /></a></li>
                <li><a href=""><ImTwitter /></a></li>
                <li><a href=""><ImFacebook2 /></a></li>
                <li><a href=""><ImLinkedin /></a></li>
                <li><a href=""><ImInstagram /></a></li>
            </ul>
        </section>
    );
}
